            alignItems: 'center',

        },
        window : {
            width: '500px',
            height: '600px',
            backgroundColor: '#0d1a2c',
            color: 'white',

        },
    }
    return (
        <div style={css.body}>
            <div style={css.window}>

            </div>

        </div>
    )
}
export default SingIn
